	static #close = '</svg>'

	static use(name){
		// Keeps SVG Body
		let body = "";

		// Invalid Name Value
		if(!!name === false) body = SVG.all["block_circle"];

		// If Exists
		if(name in SVG.all) body = SVG.all[name];

		// Fallback SVG
		else body = SVG.all["block_circle"];

		// Build And Return
		return SVG.#open + body + SVG.#close;
	}

	static load(SVGs){
		if(!!SVGs === false) return;

		for(const svg in SVGs) SVG.all[svg] = SVGs[svg];
	}
